import logo from './logo.svg';
import './App.css';
import axios from 'axios';


function App() {
  const [user,setUsers]=useState([])

  useEffect(()=>{
    axios.get('http://localhost:4000/ClientHome')
    .then(users => setUsers(users.data))
    .catch(err => console.log(err))
  })
  return (
    <div className="App">
      <h1> {users.map(user =>{
        <p> {user.name}</p>
      })}</h1>
    </div>
  );
}

export default App;
